import ComponentDidMount from './component-did-mount';
import ComponentWillMount from './component-will-mount';
import ComponentWillReceiveProps from './component-will-receive-props';

class ComponentLifeCycle extends React.Component {
  render() {
    return (
      <div>
        <ComponentDidMount />
        <ComponentWillMount />
        <ComponentWillReceiveProps counter="1" />
      </div>
    );
  }
}

export default ComponentLifeCycle;
